prompt Importing table SMS_ELEMENT...
set feedback off
set define off

-- Create table
create table SMS_ELEMENT
(
  id             VARCHAR2(36) default sys_guid(),
  code           VARCHAR2(100) not null,
  name           VARCHAR2(300),
  widget_id      VARCHAR2(36) not null,
  create_date    DATE,
  create_user_id VARCHAR2(36),
  update_date    DATE,
  update_user_id VARCHAR2(36),
  parent_id      VARCHAR2(36)
)
tablespace FINANCE_DATA
  pctfree 10
  initrans 1
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );
-- Add comments to the columns 
comment on column SMS_ELEMENT.id
  is '元素主键';
comment on column SMS_ELEMENT.code
  is '元素编号';
comment on column SMS_ELEMENT.name
  is '标签';
comment on column SMS_ELEMENT.widget_id
  is '所属控件ID';
comment on column SMS_ELEMENT.create_date
  is '创建时间';
comment on column SMS_ELEMENT.create_user_id
  is '创建用户ID';
comment on column SMS_ELEMENT.update_date
  is '更新时间';
comment on column SMS_ELEMENT.update_user_id
  is '更新用户ID';
comment on column SMS_ELEMENT.parent_id
  is '父元素ID';

